import './App.css';
import Navbar from './js/Navbar';
import Home from './js/Home';
import './css/Nav.css'
import { Routes, Route, Router} from 'react-router-dom';

function App() {
  return (
  //     <Navbar />
  //     <Routes>        
  //       <Route path="/" element={<Home />} />
  //       {/* Add other routes as needed */}
  //     </Routes>
  //   </>
    <nav className="navbar">
              <div className="logo">MyAppLogo</div>
              <div className="nav-links">
                  <div className="nav-item" onClick={handleHomeClick}>
                      <Link to="/">HOME</Link>
                  </div>
                  <div className="nav-item"
                      onMouseEnter={() => setShowAiDropdown(true)} 
                      onMouseLeave={() => setShowAiDropdown(false)}>
                      COURSES
                      {showAiDropdown && (
                          <div className="dropdown-content">
                              {/* Dropdown links */}
                          </div>
                      )}
                  </div>
                  <div className="nav-item"
                      onMouseEnter={() => setShowCodingDropdown(true)} 
                      onMouseLeave={() => setShowCodingDropdown(false)}>
                      CODING
                      {showCodingDropdown && (
                          <div className="dropdown-content">
                              {/* Dropdown links */}
                          </div>
                      )}
                  </div>
                  <div className="nav-item" onClick={handleHomeClick}>
                      <Link to="/about-us">ABOUT US</Link>
                  </div>
                  {!isLoggedIn && 
                      <div className="nav-item">
                          <Link to="/sign-up">SIGN UP</Link>
                      </div>
                  }
                  {isLoggedIn && 
                      <div className="nav-item" onClick={onLogout}>
                          LOGOUT
                      </div>
                  }
              </div>
          </nav>

  );
} 

export default App;
